def bubble_sort(to_sort_list):
    change_num = True
    y = len(to_sort_list) - 1

    while change_num:
        change_num = False
        x = 0

        while x < y:
            if to_sort_list[x] > to_sort_list[x+1]:
                to_sort_list[x], to_sort_list[x + 1] = to_sort_list[x + 1], to_sort_list[x]
                change_num = True
            x += 1

